import React, { useEffect, useState } from "react";
import axios from "axios";

function App1() {
  const [data, setData] = useState();

  useEffect(() => {
    const options = {
      method: "GET",
      params: { key: "d29f1de33c830688cf5c5d510f60e9d5", q: "chicken" },
      headers: {
        "X-RapidAPI-Key": "e8e6d1cb20msh3c038ddf785e626p1a61ccjsn3f1d9d72ccb6",
        "X-RapidAPI-Host": "community-food2fork.p.rapidapi.com",
      },
    };

    axios
      .get("https://community-food2fork.p.rapidapi.com/search", options)
      .then((response) => {
        setData(response.data.recipes);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return (
    <div className="app">
      {data &&
        data.map((item, index) => (
          <div className="item-container" key={index}>
            Id: {index} <div className="title">Title: {item.title}</div>
          </div>
        ))}
    </div>
  );
}

export default App1;
